def generate_next_filename():
    base, ext = "hasil", ".txt"
    if not os.path.exists(base + ext):
        return base + ext
    counter = 2
    while True:
        filename = f"{base}-{counter}{ext}"
        if not os.path.exists(filename):
            return filename
        counter += 1

banner_text = r"""
  ____       ____            
 |  _ \     |  _ \  _____  __
 | |_) |____| | | |/ _ \ \/ /
 |  _ <_____| |_| | (_) >  < 
 |_| \_\    |____/ \___/_/\_\
                             
"""

def display_banner():
    panel = Panel.fit(banner_text,
                      title="[bold cyan]Codename: RenXploit[/bold cyan]",
                      subtitle="[bold magenta][/bold magenta] | ___/\\___/",
                      style="magenta")
    console.print(panel)

def loading_animation(message="Loading", duration=3):
    with Progress(SpinnerColumn(), TextColumn("[progress.description]{task.description}"),
                  TimeElapsedColumn(), transient=True) as progress:
        task = progress.add_task(f"{message}...", total=duration)
        start = time.time()
        while time.time() - start < duration:
            progress.update(task, completed=time.time() - start)
            time.sleep(0.1)

def confetti_animation(duration=2):
    end_time = time.time() + duration
    colors = ["red", "green", "yellow", "blue", "magenta", "cyan"]
    while time.time() < end_time:
        line = "".join(f"[{(col := random.choice(colors))}]*[/{col}]" for _ in range(50))
        console.print(line)
        time.sleep(0.05)
    os.system('cls' if os.name == 'nt' else 'clear')
    display_banner()

def fireworks_animation(duration=3):
    end_time = time.time() + duration
    colors = ["red", "green", "yellow", "blue", "magenta", "cyan"]
    explosions = ["KONTOL!", "LU WIBUUU!", "AMBATUKAMMM!", "EPEP!", "PELERRR BAPAK KAUU PECAHH", "SUNGKEMM SEPUHHH EPEP"]
    while time.time() < end_time:
        line = ""
        for _ in range(60):
            if random.random() < 0.05:
                col = random.choice(colors)
                line += f"[{col}]{random.choice(explosions)}[/{col}]"
            else:
                col = random.choice(colors)
                line += f"[{col}].[/{col}]"
        console.print(line)
        time.sleep(0.1)
    os.system('cls' if os.name == 'nt' else 'clear')
    display_banner()

