def perform_search():
    try:
        query = console.input("[bold red]Dork:[/bold red] ").strip()
        domain = console.input("[bold red]Domain (contoh: .com, .id, dll):[/bold red] ").strip()
        if domain:
            query += f" site:{domain}"
        pages = int(console.input("[bold red]Jumlah Hasil (Page):[/bold red] "))
        delay = int(console.input("[bold red]Delay per hasil (detik):[/bold red] "))
        console.print()
        filename = generate_next_filename()
        count = 0
        with open(filename, 'w') as f:
            f.write("")
        loading_animation("Mencari dork", duration=2)
        with Progress(SpinnerColumn(), TextColumn("[progress.description]{task.description}"), transient=True) as progress:
            task = progress.add_task("Searching...", total=None)
            for url in search(query, num_results=pages, lang="en"):
                count += 1
                console.print(f"[white]{count}) [green]{url}[/green]")
                with open(filename, 'a') as f:
                    f.write(url + "\n")
                time.sleep(delay)
            progress.remove_task(task)
        console.print(f"\n[white]Hasil pencarian disimpan di: [green]{filename}[/green]\n")
    except ValueError:
        console.print("[bold red]Error: Input tidak valid![/bold red]")
    except KeyboardInterrupt:
        console.print("\n[bold red]Exit: Program dihentikan.[/bold red]")

