def export_to_csv():
    files = [f for f in os.listdir('.') if f.startswith("hasil") and f.endswith(".txt")]
    if not files:
        console.print("\n[bold yellow]File hasil tidak ditemukan![/bold yellow]\n")
        return
    def sort_key(name):
        if name == "hasil.txt":
            return 1
        try:
            return int(name.split('-')[1].split('.')[0])
        except:
            return 1
    files.sort(key=sort_key)
    latest_file = files[-1]
    try:
        with open(latest_file, "r") as infile:
            lines = [line.strip() for line in infile if line.strip()]
        if not lines:
            console.print(f"\n[bold yellow]Tidak ada data di {latest_file} untuk diekspor.[/bold yellow]\n")
            return
        csv_filename = latest_file.replace(".txt", ".csv")
        loading_animation("Mengekspor ke CSV", duration=2)
        with open(csv_filename, "w", newline="") as csvfile:
            writer = csv.writer(csvfile)
            writer.writerow(["No", "URL"])
            for idx, url in enumerate(lines, start=1):
                writer.writerow([idx, url])
        console.print(f"\n[white]Hasil berhasil diekspor ke: [green]{csv_filename}[/green]\n")
    except Exception as e:
        console.print(f"\n[red]Gagal mengekspor ke CSV: {e}[/red]\n")

